import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

// ATENÇÃO: Importando da pasta 'Pages' (Maiúsculo, conforme sua imagem)
import Home from './Pages/Home';
import Cadastro from './Pages/Cadastro';

// Se você não tiver o arquivo App.module.css, comente a linha abaixo para testar
// import styles from './App.module.css'; 

function App() {
  return (
    <Router>
      <div style={{ padding: '20px', backgroundColor: '#2c3e50', marginBottom: '20px' }}>
        {/* Menu simples inline para garantir que apareça */}
        <nav style={{ display: 'flex', gap: '20px', justifyContent: 'center' }}>
          <Link to="/" style={{ color: 'white', textDecoration: 'none', fontWeight: 'bold' }}>HOME</Link>
          <Link to="/cadastro" style={{ color: 'white', textDecoration: 'none', fontWeight: 'bold' }}>NOVO PERSONAGEM</Link>
        </nav>
      </div>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/cadastro" element={<Cadastro />} />
      </Routes>
    </Router>
  );
}

export default App;
